def compute_preconditioner_only_H(template_c, Hbar, gamma1, eta1, lambda2, lambda3):
    sigma = {}
    c = {}
    diagonal = [np.array([0.0])]
    # iv block
    print("Starts iv block precond", flush=True)
    shape_block = template_c['iv'].shape[1:]
    shape_size = np.prod(shape_block)
    c['iv'] = np.zeros((shape_size, *shape_block))
    sigma['iv'] = np.zeros((shape_size, *shape_block))
    c = vec_to_dict(c, np.identity(shape_size))
    c = antisymmetrize(c)
    sigma['iv'] += -1.00000000 * np.einsum('cd,pde->pce',Hbar['ii'],c['iv'],optimize=True)
    sigma['iv'] += -1.00000000 * np.einsum('cedf,pde->pcf',Hbar['iviv'],c['iv'],optimize=True)
    sigma['iv'] += +1.00000000 * np.einsum('ef,pce->pcf',Hbar['vv'],c['iv'],optimize=True)
    sigma = antisymmetrize(sigma)
    c.clear()
    vec = dict_to_vec(sigma, shape_size)
    sigma.clear()
    diagonal.append(vec.diagonal())
    del vec

    # IV block
    print("Starts IV block precond", flush=True)
    shape_block = template_c['IV'].shape[1:]
    shape_size = np.prod(shape_block)
    c['IV'] = np.zeros((shape_size, *shape_block))
    sigma['IV'] = np.zeros((shape_size, *shape_block))
    c = vec_to_dict(c, np.identity(shape_size))
    c = antisymmetrize(c)
    sigma['IV'] += -1.00000000 * np.einsum('CD,pDE->pCE',Hbar['II'],c['IV'],optimize=True)
    sigma['IV'] += -1.00000000 * np.einsum('CEDF,pDE->pCF',Hbar['IVIV'],c['IV'],optimize=True)
    sigma['IV'] += +1.00000000 * np.einsum('EF,pCE->pCF',Hbar['VV'],c['IV'],optimize=True)
    sigma = antisymmetrize(sigma)
    c.clear()
    vec = dict_to_vec(sigma, shape_size)
    sigma.clear()
    diagonal.append(vec.diagonal())
    del vec

    # iAaV block
    print("Starts iAaV block precond", flush=True)
    shape_block = template_c['iAaV'].shape[1:]
    shape_size = np.prod(shape_block)
    c['iAaV'] = np.zeros((shape_size, *shape_block))
    sigma['iAaV'] = np.zeros((shape_size, *shape_block))
    c = vec_to_dict(c, np.identity(shape_size))
    c = antisymmetrize(c)
    sigma['iAaV'] += -1.00000000 * np.einsum('cd,pdAaE,ao,OA->pcOoE',Hbar['ii'],c['iAaV'],eta1['aa'],gamma1['AA'],optimize=True)
    sigma['iAaV'] += +1.00000000 * np.einsum('cd,pdAaE,aOoA->pcOoE',Hbar['ii'],c['iAaV'],lambda2['aAaA'],optimize=True)
    sigma['iAaV'] += +1.00000000 * np.einsum('coda,pdArE,ro,aObA->pcObE',Hbar['iaia'],c['iAaV'],eta1['aa'],lambda2['aAaA'],optimize=True)
    sigma['iAaV'] += -1.00000000 * np.einsum('coda,pdArE,ab,ro,OA->pcObE',Hbar['iaia'],c['iAaV'],eta1['aa'],eta1['aa'],gamma1['AA'],optimize=True)
    sigma['iAaV'] += +1.00000000 * np.einsum('coda,pdArE,ab,rOoA->pcObE',Hbar['iaia'],c['iAaV'],eta1['aa'],lambda2['aAaA'],optimize=True)
