    sigma['iAvA'] += +1.00000000 * np.einsum('eoca,aAoO->cOeA',Hbar['vaia'],lambda2['aAaA'],optimize=True)
    sigma['ia'] += +0.50000000 * np.einsum('oacb,broa->cr',Hbar['aaia'],lambda2['aaaa'],optimize=True)
